uniform sampler2D sampler_x0;
uniform vec2 texture_shape_x0;
uniform vec2 texture_stride_x0;
uniform vec4 variable_shape_x0;
uniform vec4 variable_stride_x0;


void main() {
    float y;

    vec4 variable_position_y = convert_position(gl_FragCoord.xy, texture_stride_y, variable_stride_y, variable_shape_y);    


vec4 variable_position_x0 = mod(variable_position_y, variable_shape_x0);
vec2 texture_position_x0 = convert_coord(variable_position_x0, variable_stride_x0, texture_stride_x0, texture_shape_x0);
float x0 = texture2D(sampler_x0, texture_position_x0).r;
y = x0;

    gl_FragColor = vec4(y, 0, 0, 0);
}

